import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { Button } from 'react-native-paper';
import { grey100 } from 'react-native-paper/lib/typescript/src/styles/colors';

export default function App() {
  return (
    <View>
    <StatusBar backgroundColor="blue"/>
      <Text style={{fontSize:35,marginLeft:18,marginTop:10,color:"#3b3b3b"}}>Welcome to</Text>
      <Text style={{fontSize:30,marginLeft:18,color:"grey"}}>Coders Never Quit</Text>
      <Button icon="camera" mode="contained" onPress={() => console.log('Pressed')}>
      Press me
    </Button>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
